    const [hover,setHover] = useState(false)
    const onHover = () =>{
        setHover(!hover)
    }
  return (
    <>
    <HeroContainer>
    <HeroBg>
        <VideoBg autoPlay loop muted src = {Video} type = 'video/mp4' /> 
    </HeroBg>
    <Registration_box>
        <Text_header><h5> ~ % Welcome to CICS Registration!</h5></Text_header>
